INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EMB', 'STOCK', 'iShares J.P. Morgan USD Emerging Markets Bond ETF', 'NGM', NULL, NULL, 'The fund will invest at least 80% of its assets in the component securities of the underlying index and will invest at least 90% of its assets in fixed income securities of the types included in the underlying index. The index is a broad, diverse U.S. dollar-denominated emerging markets debt benchmark that tracks the total return of actively traded external debt instruments in emerging market countries.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CZR', 'STOCK', 'Caesars Entertainment, Inc.', 'NMS', 'Consumer Cyclical', 'Resorts & Casinos', 'A Caesars Entertainment, Inc. É uma empresa de entretenimento de cassino e um provedor diversificado de jogos e hospitalidade. A empresa opera principalmente sob as marcas Caesars, Harrah''s, Horseshoe e Eldorado. Seus segmentos incluem Las Vegas, Regional, Caesars Digital e Managed and Branded, além de Corporate e outros. Oferece diversas comodidades de jogos, entretenimento e hospitalidade, destinos e um conjunto completo de jogos móveis e online e experiências de apostas esportivas. A Companhia possui, aluga ou gerencia um agregado de 53 propriedades domésticas em 18 estados. Ele também opera e realiza apostas esportivas em 32 jurisdições na América do Norte, 26 das quais oferecem apostas esportivas online, e opera iGaming em cinco jurisdições na América do Norte. Ele opera o aplicativo Caesars Sportsbook, o aplicativo Caesars Racebook, o aplicativo Caesars Palace Online Casino e o novo aplicativo Horseshoe Online Casino. Os seus jogos de casino online incluem slots, jogos de mesa, ', 'Reno, NV, United States', 50000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRML', 'STOCK', 'Critical Metals Corp.', 'NGM', 'Basic Materials', 'Other Industrial Metals & Mining', 'Critical Metals Corp. is an Australia-based mining development company. The Company is focused on mining critical metals and minerals and producing strategic products essential to electrification and technologies for Europe and its partners. Its flagship Project, Tanbreez, consists of rare earth deposits and is located in Southern Greenland. The Wolfsberg Lithium Project is located in Carinthia, over 270 kilometers south of Vienna, Austria. The Wolfsberg Lithium Project is a fully permitted mine in Europe and is strategically located with access to established road and rail infrastructure. With its strategic asset portfolio, the Company supplies critical minerals essential for defense applications, the clean energy transition, and technologies.', 'New York, NY, United States', 4);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALB', 'STOCK', 'Albemarle Corporation', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'A Albemarle Corporation está empenhada em transformar recursos essenciais em ingredientes críticos para mobilidade, energia, conetividade e saúde. Os segmentos da empresa incluem Armazenamento de Energia, Especialidades e Ketjen. O segmento de armazenamento de energia desenvolve e fabrica uma gama de compostos básicos de lítio, incluindo carbonato de lítio, hidróxido de lítio e cloreto de lítio. O seu negócio de especialidades otimiza o seu portfólio de soluções de bromo e lítio altamente especializadas. Seu negócio de especialidades atende uma variedade de indústrias, incluindo energia, mobilidade, conetividade e saúde. Os produtos especiais são essenciais tanto em veículos elétricos como de combustão interna, desde cabos de alta tensão e powertrains até airbags e pneus. Seu segmento Ketjen inclui tecnologias de combustíveis limpos (CFT), catalisadores e aditivos de craqueamento catalítico fluidizado (FCC) e soluções de catalisador de desempenho (PCS). Atende vários mercados, como arm', 'Charlotte, NC, United States', 8300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ESPR', 'STOCK', 'Esperion Therapeutics, Inc.', 'NGM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Esperion Therapeutics, Inc. is a commercial stage biopharmaceutical company. The Company is focused on developing and commercializing oral, once-daily, non-statin medicines for patients who are at risk for cardiovascular disease (CVD) and are struggling with elevated low-density lipoprotein cholesterol (LDL-C). Its products include NEXLETOL, NEXLIZET, NILEMDO and NUSTENDI. Its NEXLETOL and NEXLIZET (bempedoic acid and ezetimibe) tablets are oral, once-daily, non-statin medicines to lower the risk of myocardial infarction and coronary revascularization in adults with primary hyperlipidemia. Its NEXLETOL is an ATP Citrate Lyase (ACLY), inhibitor that lowers LDL-C and cardiovascular risk by reducing cholesterol biosynthesis and up-regulating the LDL receptors. Its NUSTENDI contains bempedoic acid and ezetimibe and lowers elevated LDL-C through complementary mechanisms of action by inhibiting cholesterol synthesis in the liver and absorption in the intestine.', 'Ann Arbor, MI, United States', 304);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BAX', 'STOCK', 'Baxter International Inc.', 'NYQ', 'Healthcare', 'Medical Instruments & Supplies', 'Baxter International Inc. É uma empresa global de medtech. Seus segmentos incluem Produtos e Terapias Médicos, Sistemas e Tecnologias de Saúde e Farmacêuticos. O segmento de Produtos e Terapias Médicos inclui a venda de suas soluções estéreis IV, sistemas de infusão, conjuntos de administração, terapias de nutrição parenteral e hemostato cirúrgico, selante e produtos de prevenção de adesão. O segmento de Sistemas e Tecnologias de Saúde inclui as vendas de suas soluções de cuidados conetados e ferramentas de colaboração, incluindo sistemas de cama inteligente, sistemas de monitoramento de pacientes e tecnologias de diagnóstico, dispositivos de saúde respiratória e equipamentos avançados para o espaço cirúrgico, incluindo tecnologias de integração de sala de operação, dispositivos de posicionamento de precisão e outros acessórios. O segmento Pharmaceuticals inclui vendas de especialidades farmacêuticas injetáveis, anestesia inalada e composição de medicamentos. Fornece um portfólio de pr', 'Deerfield, IL, United States', 38000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EPD', 'STOCK', 'Enterprise Products Partners L.P.', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'Enterprise Products Partners L.P. provides midstream energy services to producers and consumers of natural gas, natural gas liquids (NGLs), crude oil, petrochemicals, and refined products. It operates in four segments: NGL Pipelines & Services, Crude Oil Pipelines & Services, Natural Gas Pipelines & Services, and Petrochemical & Refined Products Services. The NGL Pipelines & Services segment offers natural gas processing and related NGL marketing activities. This segment operates natural gas processing facilities located in Colorado, Louisiana, Mississippi, New Mexico, Texas, and Wyoming; NGL pipelines; NGL fractionation facilities; NGL and related product storage facilities; and NGL marine terminals. The Crude Oil Pipelines & Services segment operates crude oil pipelines; and crude oil storage and marine terminals, which include a fleet of approximately 225 tractor-trailer tank trucks that are used to transport crude oil. It also engages in crude oil marketing activities. The Natural ', 'Houston, TX, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTU', 'STOCK', 'Peabody Energy Corporation', 'NYQ', 'Energy', 'Thermal Coal', 'Peabody Energy Corporation is a coal producer, providing essential products for the production of reliable energy and steel. The Company owns interests in coal mining operations located in the United States and Australia, including interests in Middlemount Coal Pty Ltd. The Company engages in the direct and brokered trading of coal and freight-related contracts. Its segments include Seaborne Thermal, Seaborne Metallurgical, Powder River Basin, Other U.S. Thermal, and Corporate and Other. The Seaborne Thermal operations consist of mines in New South Wales, Australia. The mines in that segment utilize both surface and underground extraction processes to mine low-sulfur, high Btu thermal coal. The Seaborne Metallurgical operations consist of mines in Queensland, Australia, one in New South Wales, Australia and one in Alabama, the United States. The Company owns the southern portion of the Wards Well tenement.', 'Saint Louis, MO, United States', 5600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTCS', 'STOCK', 'BTCS Inc.', 'NCM', 'Financial Services', 'Capital Markets', 'BTCS Inc. is blockchain technology company focused on advancing blockchain infrastructure. The Company operates a network of cloud-based validator nodes that perform essential roles in PoS and dPoS blockchain ecosystems. The Companys primary activities include Ethereum block-building (Builder+) and validator node operations (NodeOps) across PoS and dPoS networks. The Company primarily earn crypto assets through the operation of its non-custodial validator nodes, with the intention of enhancing the production of crypto assets in various blockchain networks. Builder+ is comprised of an advanced block-building operations that leverages advanced algorithms to drive scalable revenue by optimizing the structure and composition of transactions in on-chain blocks. The Company has developed ChainQ, an AI-powered blockchain data and analytics platform designed to increase transparency and accessibility in the blockchain ecosystem.', 'Silver Spring, MD, United States', 7);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTRA', 'STOCK', 'Coterra Energy Inc.', 'NYQ', 'Energy', 'Oil & Gas E&P', 'A Coterra Energy Inc. É uma empresa de exploração e produção com sede em Houston, Texas, com operações focadas na Bacia Permiana, no xisto Marcellus e na Bacia Anadarko. A empresa está envolvida no desenvolvimento, exploração e produção de petróleo, gás natural e líquidos de gás natural exclusivamente dentro dos Estados Unidos continental. Sua operação da bacia do Permiano consiste em aproximadamente 345 000 acres líquidos. Suas atividades de desenvolvimento estão focadas principalmente no xisto Wolfcamp e na formação de primavera óssea em Culberson e Counties Reeves no Texas e Condados Lea e Eddy no Novo México. Sua operação de xisto Marcellus inclui propriedades que estão localizadas principalmente no Condado de Susquehanna, Pensilvânia, onde possui aproximadamente 186 000 acres líquidos na janela de gás seco do xisto de Marcellus. Sua operação Anadarko Basin detém cerca de 182 000 acres líquidos que estão localizados em Oklahoma. Suas atividades de desenvolvimento estão focadas prin', 'Houston, TX, United States', 915);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CYBR', 'STOCK', 'CyberArk Software Ltd.', 'NMS', 'Technology', 'Software - Infrastructure', 'CyberArk Software Ltd is an Israel-based provider of information technology (IT) security solutions that protect organizations from cyber-attacks. The Company''s software solutions are focused on protecting privileged accounts, which have become a critical target in the lifecycle of cyber-attacks. The Company''s Privileged Account Security Solution consists of various products, such as Shares Technology Platform, Enterprise Password Vault, SSH Key Manager, Privileged Session Manager, Privileged Threat Analytics, Application Identity Manager, CyberArk-Conjur, Endpoint Privilege Manager and On-Demand Privileges Manager. The Company''s products protect against external and internal cyber threats and enable detection and neutralization of attacks. The Company''s Enterprise Password Vault provides customers with a tool to manage and protect all privileged accounts across an entire organization, including physical, virtual, or cloud-based assets.', 'Petah Tikva, , Israel', 3793);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAPU', 'STOCK', 'Direxion Daily AAPL Bull 2X Shares', 'NGM', NULL, NULL, 'The fund, under normal circumstances, invests at least 80% of its net assets (plus any borrowings for investment purposes) in the securities of AAPL and financial instruments, such as swap agreements and options, that, in combination, provide 2X daily leveraged exposure to AAPL, consistent with the fund’s investment objective. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APLS', 'STOCK', 'Apellis Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Apellis Pharmaceuticals, Inc. is a commercial-stage biopharmaceutical company. The Company is focused on the discovery, development and commercialization of novel therapeutic compounds to treat diseases with high unmet needs through the inhibition of the complement system. SYFOVRE (pegcetacoplan injection) is the Companys approved treatment for geographic atrophy secondary to age-related macular degeneration (GA). Its EMPAVELI (pegcetacoplan) is for the treatment of paroxysmal nocturnal hemoglobinuria (PNH). Its Aspaveli (pegcetacoplan) for the treatment of adults with PNH who are anemic after treatment with a C5 inhibitor for at least three months. Systemic pegcetacoplan has also been approved for the treatment of PNH in Japan, Saudi Arabia, Australia, the United Kingdom and other jurisdictions. Systemic pegcetacoplan is marketed under the trade name EMPAVELI in the United States, Saudi Arabia and Australia and Aspaveli in the European Union, Japan and the United Kingdom.', 'Waltham, MA, United States', 705);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABBV', 'STOCK', 'AbbVie Inc.', 'NYQ', 'Healthcare', 'Drug Manufacturers - General', 'A AbbVie Inc. É uma empresa biofarmacêutica global e diversificada baseada em pesquisa. A empresa está envolvida em pesquisa e desenvolvimento, fabricação, comercialização e venda de medicamentos e terapias. O seu portfólio de produtos inclui Imunologia, Oncologia, Estética, Neurociência, Cuidados com os Olhos e outros produtos-chave. Seus produtos de Imunologia incluem reumatologia, dermatologia e gastroenterologia. Seus produtos de oncologia incluem Imbruvica, Venclexta/Venclyxto, Elahere e Epkinly. O portfólio de estética da empresa consiste em injetáveis faciais, plásticos e medicina regenerativa, contorno corporal e produtos para a pele. Seus produtos de Neurociência incluem Botox Therapeutic, Vraylar, Duopa e Duodopa, Ubrelvy e Qulipta. Os seus produtos para cuidados com os olhos incluem Ozurdex, Lumigan/Ganfort, Alphagan/Combigan, Restasis e outros cuidados oculares. Seus outros produtos-chave incluem Mavyret/Maviret, Creon e Linzess/Constella. O seu Venclexta é um inibidor do l', 'North Chicago, IL, United States', 55000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OXLC', 'STOCK', 'Oxford Lane Capital Corp.', 'NGM', 'Financial Services', 'Asset Management', 'Oxford Lane Capital Corp. (the Fund) is a closed-end management investment company. The Funds investment objective is to maximize its portfolios risk-adjusted total return. The Fund seeks to achieve its investment objective by investing in structured finance investments, specifically the equity and junior debt tranches of collateralized loan obligation (CLO) vehicles, which are collateralized primarily by a diverse portfolio of senior secured loans made to companies whose debt is unrated or is rated below investment grade (the Senior Loans) and, to a limited extent, subordinated and/or unsecured loans and bonds (CLO Assets). Below investment grade securities, such as the CLO securities in which the Fund primarily intends to invest, are often referred to as junk. The Funds investment activities are managed by Oxford Lane Management, LLC (Oxford Lane Management), which is its investment adviser.', 'Greenwich, CT, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('GILD', 'STOCK', 'Gilead Sciences, Inc.', 'NMS', 'Healthcare', 'Drug Manufacturers - General', 'A Gilead Sciences, Inc. É uma empresa biofarmacêutica. A empresa está envolvida no avanço de medicamentos para prevenir e tratar doenças que ameaçam a vida, incluindo o vírus da imunodeficiência humana (HIV), hepatite viral, COVID-19, câncer e inflamação. Está focada na descoberta, desenvolvimento e entrega de medicamentos para atender às necessidades médicas não atendidas em virologia, oncologia e outras áreas terapêuticas. Seu portfólio de produtos comercializados inclui Biktarvy, Genvoya, Descovy, Complera/Eviplera, Symtuza, Truvada, Stribild, Sunlenca, Epclusa, Vemlidy, Harvoni, Viread, Livdelzi, Viklury, Yescarta, Tecartus, Trodelvy, AmBisoma e Letairis. Os seus candidatos a produtos incluem Bulevrtide, Lenacapavir, Axicabtagene ciloleucel, Anitocabtagene autoleucel, Sacituzumab govitecan-hziy, e Domvanalimab e zimberelimab. Biktarvy é uma formulação oral dosado uma vez por dia para o tratamento da infeção pelo HIV-1 em certos pacientes. Opera em mais de 35 países em todo o mundo.', 'Foster City, CA, United States', 17600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASPI', 'STOCK', 'ASP Isotopes Inc.', 'NCM', 'Basic Materials', 'Chemicals', 'ASP Isotopes Inc. is a development stage advanced materials company. The Company is engaged in the development of technology and processes to produce isotopes for use in multiple industries. The Company employs proprietary technology, the Aerodynamic Separation Process (ASP technology). Its initial focus is on producing and commercializing highly enriched isotopes for the healthcare and technology industries. Its Nuclear Fuels segment is focused on research and development of technologies and methods used to produce high-assay low-enriched uranium (HALEU) and Lithium-6 for the advanced nuclear fuels target end market. Its Specialist Isotopes and Related Services segment is focused on research and development of technologies and methods used to separate high-value, low-volume isotopes (such as C-14, Mo-100, and Si-28) for highly specialized target end markets other than advanced nuclear fuels, including pharmaceuticals and agrochemicals, nuclear medical imaging, and others.', 'Washington, DC, United States', 136);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('B', 'STOCK', 'Barrick Mining Corporation', 'NYQ', 'Basic Materials', 'Gold', 'A BARRICK MINING CORPORATION é uma produtora de ouro e cobre sediada no Canadá, que está envolvida na produção e venda de ouro e cobre, bem como atividades relacionadas, como exploração e desenvolvimento de minas. Tem interesses de propriedade na produção de minas de ouro que estão localizadas na Argentina, Canadá, Costa do Marfim, República Democrática do Congo, República Dominicana, Mali, Tanzânia e Estados Unidos. Tem interesses de propriedade na produção de minas de cobre no Chile, Arábia Saudita e Zâmbia. Suas operações incluem minas de ouro de Nevada, Bulyanhulu, Hemlo, Jabal Sayid, Kibali, Loulo-Gounkoto, Lumwana, North Mara, Porgera, Pueblo Viejo, Tongon, Veladero e Zaldivar. Sua operação Bulyanhulu está localizada no noroeste da Tanzânia, aproximadamente 55 quilômetros (km) ao sul do Lago Victoria e 150 km a sudoeste da cidade de Mwanza. A operação Hemlo está localizada ao norte do Lago Superior na Rodovia Trans-Canadá, a aproximadamente 35 km a leste de Maratona, Ontário, e é', 'Toronto, ON, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BURU', 'STOCK', 'Nuburu, Inc.', 'ASE', 'Industrials', 'Specialty Industrial Machinery', 'NUBURU, Inc. is a developer and manufacturer of industrial blue laser technology. The Company is an innovator in high-power, high-brightness blue laser technology that is focused on bringing improvements to a broad range of high-value applications, including welding and three-dimensional (3D) printing. It provides blue laser systems for welding applications, such as batteries, large screen displays, and cell phone components. Its products include NUBURU BL Series, NUBURU BL-F Series and NUBURU BL-250 With Scanner. NUBURU BL series includes industrial blue lasers that deliver a free-space beam, and are available with output powers of up to 250 W. The fiber-delivered NUBURU BL-F Series extends output powers up to 1 kW. It provides manufacturers with blue lasers for welding, cutting, stripping coatings and 3D printing. The Company offers its products in energy storage, aerospace, e-mobility, defense-tech, security, operational resilience solutions, and other sectors.', 'Centennial, CO, United States', 8);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AXGN', 'STOCK', 'Axogen, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'Axogen, Inc. is focused on the science, development, and commercialization of technologies for peripheral nerve regeneration and repair. It offers repair solutions for surgeons and healthcare providers. Its portfolio of products includes Avance Nerve Graft, Axoguard Nerve Connector, Axoguard Nerve Protector, Axoguard HA+ Nerve Protector, Axoguard Nerve Cap, and Avive+ Soft Tissue Matrix. Avance Nerve Graft is a biologically active off-the-shelf processed human nerve allograft for bridging severed peripheral nerves. The Axoguard Nerve Connector is a porcine (pig) submucosa extracellular matrix (ECM) coaptation aid for tensionless repair of severed peripheral nerves. Axoguard Nerve Protector is a porcine submucosa ECM product used to wrap and protect damaged peripheral nerves and reinforce the nerve reconstruction while preventing soft tissue attachments. Axoguard HA+ Nerve Protector consists of a processed porcine submucosa ECM base layer with a hyaluronate-alginate gel coating.', 'Alachua, FL, United States', 451);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DEFT', 'STOCK', 'DeFi Technologies Inc.', 'NCM', 'Financial Services', 'Capital Markets', 'DeFi Technologies Inc. is a financial technology company that pioneers the convergence of traditional capital markets with decentralized finance (DeFi). The Companys business lines include Asset Management, DeFi Alpha, Stillman Digital, DeFi Ventures, and Reflexivity Research LLC. In the asset management business, the Company, through its subsidiaries, Valour Inc. and Valour Digital Securities Limited) is developing Exchange Traded Products (ETPs) that synthetically track the value of a single DeFi protocol or a basket of protocols. Defi Alpha, a specialized arbitrage trading desk with the focus is to identify low-risk arbitrage opportunities within the crypto ecosystem. Stillman Digital is a digital asset liquidity provider that offers liquidity solutions for businesses, focusing on industry-leading trade execution, settlement and technology. The Companys Research Reflexivity LLC line of business specializes in producing cutting-edge research reports for the cryptocurrency industry.', 'Toronto, ON, Canada', 9);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTM', 'STOCK', 'Castellum, Inc.', 'ASE', 'Technology', 'Information Technology Services', 'Castellum, Inc. is a technology company in the areas of cybersecurity, information technology (IT), electronic warfare, information warfare, and information operations with businesses in the defense, federal, civilian, and commercial markets. The Companys services include intelligence analysis, software development, software engineering, program management, strategic and mission planning, information assurance, cybersecurity and policy support, data analytics, and model based systems engineering (MBSE). These services focus on securing data and establishing related policies, and are applicable to customers in the federal government, financial services, healthcare, and other users of large data applications. It specializes in planning and intelligence support for information warfare and information operations (IW/IO). The Company develops IW/IO plans, exercises, doctrine, and training for the Military Services and the Combatant Commands in domestic and deployed overseas locations.', 'Vienna, VA, United States', 238);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COUR', 'STOCK', 'Coursera, Inc.', 'NYQ', 'Consumer Defensive', 'Education & Training Services', 'O Coursera, Inc. Fornece uma plataforma de aprendizagem online que coneta alunos, educadores e instituições, fornecendo conteúdo educacional acessível e relevante. Os segmentos da empresa incluem Consumer, Enterprise e Degrees. A empresa fornece uma gama de conteúdo de aprendizagem e credenciais, incluindo clipes, Projetos Guiados, Especializações, cursos, e certificados que podem construir para um curso mais amplo de estudo, como um diploma ou diploma de pós-graduação. Suas ofertas incluem Coursera.org para indivíduos, Coursera para empresas, Coursera para negócios, Coursera para campus e Coursera para governo. Ele oferece um portfólio de certificados profissionais de nível básico do Google, IBM, Intuit, Meta, Microsoft, e a Salesforce que ajudam a desenvolver as habilidades necessárias para conseguir empregos digitais de nível básico em tecnologia da informação, segurança cibernética, ciência de dados, marketing, vendas, design e engenharia de software e desenvolvimento sem exigir um', 'Mountain View, CA, United States', 1260);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FLG', 'STOCK', 'Flagstar Financial, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Flagstar Financial, Inc. is the parent company of Flagstar Bank, N.A. (the Bank), one of the regional banks in the country. Flagstar Bank, N.A. operates over 418 branches, including a significant presence in the Northeast and Midwest and locations in high growth markets in the Southeast and West Coast. In addition, the Bank has approximately 80 private banking teams located in over 10 cities in the metropolitan New York City region and on the West Coast, which serve the needs of high-net worth individuals and their businesses. The Bank''s service offerings include treasury management, banking services, business loans, asset-based lending, checking account, savings, home equity line of credit, residential lending, personal private banking, credit cards, home loans, home equity, investment services and online treasury services with Flagstar Corporate Connect, among others.', 'Hicksville, NY, United States', 6993);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLSD', 'STOCK', 'Clearside Biomedical, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Clearside Biomedical, Inc. is a biopharmaceutical company focused on the delivery of therapies to the back of the eye through the suprachoroidal space (SCS). The Company''s SCS injection platform, utilizing its patented SCS Microinjector, enables an in-office, repeatable, non-surgical procedure for the targeted and compartmentalized delivery of a variety of therapies to the macula, retina, or choroid to potentially preserve and improve vision in patients with sight-threatening eye diseases. The Company is developing its own pipeline of small molecule product candidates for administration via its SCS Microinjector. The Company''s lead program, CLS-AX (axitinib injectable suspension), for the treatment of neovascular age-related macular degeneration (wet AMD). It developed and gained approval for its product, XIPERE (triamcinolone acetonide injectable suspension) for suprachoroidal use, which is available in the United States through a commercial partner.', 'Alpharetta, GA, United States', 32);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DVN', 'STOCK', 'Devon Energy Corporation', 'NYQ', 'Energy', 'Oil & Gas E&P', 'A Devon Energy Corporation é uma produtora de petróleo e gás nos Estados Unidos, com um portfólio diversificado de várias bacias, encabeçado por uma posição de acreage na Delaware Basin. A empresa está envolvida principalmente na exploração, desenvolvimento e produção de petróleo, gás natural e líquidos de gás natural (NGL). Possui um portfólio de ativos localizados na Bacia de Delaware, Rockies, Eagle Ford e Anadarko Basin. A Bacia de Delaware opera no sudeste do Novo México e através da linha do estado até o oeste do Texas. Oferece oportunidades de exploração e desenvolvimento de muitos reservatórios geológicos e tipos de jogo, incluindo as formações ricas em petróleo Wolfcamp, Bone Spring, Avalon e Delaware. Seu desenvolvimento das Montanhas Rochosas consiste em seus ativos de Williston Basin e Powder River Basin. As operações da Eagle Ford estão localizadas nos condados de DeWitt e Karnes, Texas. O desenvolvimento da Bacia Anadarko está localizado no oeste de Oklahoma. Tem uma join', 'Oklahoma City, OK, United States', 2300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DEVS', 'STOCK', 'DevvStream Corp.', 'NCM', 'Industrials', 'Pollution & Treatment Controls', 'DevvStream Corp is a carbon credit project co-development and generation company, which specializes in technology-based solutions. The Company operates across three strategic domains: an offset portfolio consisting of nature-based, tech-based, and carbon sequestration credits for immediate sale to corporations and governments seeking to offset their difficult-to-reduce emissions; project investment, acquisitions, and industry consolidation to extend the Company''s reach, allowing it to become a full end-to-end solutions provider, and project development, where the Company serves as project manager for activities such as electric vehicles charging in exchange for a percentage of generated credits. Its end-to-end proprietary solution removes risk and complexity from every step, allowing organizations to move from project ideation to credit monetization. The Company also provides carbon credits for purchases.', 'Vancouver, BC, Canada', 5);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRDO', 'STOCK', 'Credo Technology Group Holding Ltd', 'NMS', 'Technology', 'Semiconductors', 'Credo Technology Group Holding Ltd is a Cayman Islands-based holding company. The Company delivers high-speed solutions to break bandwidth barriers on every wired connection in the data infrastructure market. It provides high-speed connectivity solutions that deliver improved power efficiency as data rates and corresponding bandwidth requirements increase exponentially throughout the data infrastructure market. Its connectivity solutions are optimized for optical and electrical Ethernet applications, including the emerging 100 gigabits per second (G), 200G, 400G, 800G and the emerging 1.6 terabits per second (T) port markets. Its products are based on its Serializer/Deserializer (SerDes) and Digital Signal Processor (DSP) technologies. Its product families include integrated circuits (ICs) for the optical and line card markets, active electrical cables (AECs) and SerDes Chiplets. The Companys intellectual property (IP) solutions consist primarily of SerDes IP licensing.', 'Grand Cayman, , Cayman Islands', 622);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTAI', 'STOCK', 'BioXcel Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'BioXcel Therapeutics, Inc. is a biopharmaceutical company utilizing artificial intelligence to develop medicines in neuroscience. Its subsidiary, OnkosXcel Therapeutics LLC, is focused on the development of medicines in immuno-oncology. Its advanced neuroscience candidate, BXCL501, is an investigational, orally dissolving film formulation of dexmedetomidine in development for the treatment of agitation associated with psychiatric and neurological disorders. It is continuing to develop BXCL501 for the potential acute treatment of agitation associated with bipolar disorder or schizophrenia in the at-home setting and for the potential acute treatment of agitation (non-daily) associated with dementia due to probable Alzheimers disease in the at-home setting and in care facilities. Its advanced immuno-oncology candidate, BXCL701, is an investigational oral innate immune activator for the treatment of aggressive forms of prostate cancer, pancreatic cancer, and other solid and liquid tumors.', 'New Haven, CT, United States', 37);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRM', 'STOCK', 'Salesforce, Inc.', 'NYQ', 'Technology', 'Software - Application', 'A Salesforce, Inc. É uma fornecedora de tecnologia de gerenciamento de relacionamento com o cliente (CRM). A empresa ajuda organizações de qualquer porte a reimaginar seus negócios para o mundo da inteligência artificial (IA). Com a Agentforce, sua plataforma, as organizações podem reunir humanos com agentes para impulsionar o sucesso do cliente com inteligência artificial, dados e ação. Com a plataforma Salesforce, a empresa oferece uma única fonte de verdade, conetando dados de clientes com IA integrada em sistemas, aplicativos e dispositivos para ajudar as empresas a vender, atender, comercializar e conduzir o comércio de qualquer lugar. Agentforce é uma nova camada da plataforma Salesforce que permite que as empresas criem e implantem agentes de IA que podem responder a entradas, tomar decisões e agir de forma autônoma em todas as funções de negócios. Agentforce inclui um conjunto de agentes personalizáveis para uso em vendas, serviços, marketing e comércio. AgentExchange é o merca', 'San Francisco, CA, United States', 76453);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLOV', 'STOCK', 'Clover Health Investments, Corp.', 'NMS', 'Healthcare', 'Healthcare Plans', 'A Clover Health Investments, Corp. É uma empresa de tecnologia de capacitação médica. A empresa está focada em trazer acesso aos cuidados de saúde para todos na Medicare. Isso inclui um foco baseado em equidade na saúde em idosos, que historicamente não têm acesso a cuidados de saúde acessíveis. Ele oferece uma plataforma de software, o Clover Assistant, que é projetado para agregar dados de pacientes de todo o ecossistema de saúde para apoiar a tomada de decisões clínicas e melhorar os resultados de saúde através da identificação precoce e gerenciamento de doenças crônicas. A Companhia, através do seu segmento de Seguros, oferece planos de Organização Preferencial de Prestadores (PPO) e Organização de Manutenção de Saúde (HMO) para membros da Medicare Advantage (MA) em vários estados, com foco diferenciado em seus principais planos de PPO de ampla rede e de alta escolha. Para os prestadores de cuidados de saúde fora do seu plano de mestrado, a empresa se concentra em estender os benef', 'Wilmington, DE, United States', 570);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CELH', 'STOCK', 'Celsius Holdings, Inc.', 'NCM', 'Consumer Defensive', 'Beverages - Non-Alcoholic', 'Celsius Holdings, Inc. is engaged in the development, processing, marketing, sale, and distribution of functional energy drinks to a range of consumers. The Company''s flagship asset, CELSIUS, is marketed as a lifestyle and energy drink. This product line comes in two versions: a ready-to-drink form and an on-the-go powder form. It also offers a new CELSIUS Essentials line, available in 16-ounce cans and a Hydration line of zero-sugar powders that are infused with electrolytes and are available in a variety of fruit-forward flavors. Celsius products are offered in retail channels across the United States, including conventional grocery, natural, convenience, fitness, mass market, vitamin specialty and e-commerce platforms. Its product''s formulation includes ingredients and supplements such as green tea (EGCG), ginger (from the root), calcium, chromium, B vitamins and vitamin C. The Company''s product portfolio also includes the health and wellness brand Alani Nu.', 'Boca Raton, FL, United States', 1073);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WMB', 'STOCK', 'The Williams Companies, Inc.', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'A Williams Companies, Inc. É uma empresa de energia. Seus segmentos incluem serviços de marketing Transmission & Gulf of America, Northeast G&P, West e Gás & NGL. O segmento Transmission & Gulf of America compreende os gasodutos interestaduais Transco, NWP e MountainWest, e suas instalações de armazenamento de gás natural relacionadas, bem como coleta e processamento de gás natural e movimentação de produção de petróleo bruto e ativos de transporte na região da Costa do Golfo. A Northeast G&P compreende negócios de coleta, processamento e fracionamento de midstream na região de xisto de Marcellus. O segmento Oeste compreende operações de coleta, processamento e tratamento de gás na região das Montanhas Rochosas do Colorado e Wyoming, na região de xisto de Barnet do centro norte do Texas, e na região de xisto Eagle Ford do sul do Texas, entre outros. O segmento de Serviços de Marketing Gás & NGL inclui operações de comercialização e comercialização de gás natural (NGL) e gás natural.', 'Tulsa, OK, United States', 5829);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VLY', 'STOCK', 'Valley National Bancorp', 'NMS', 'Financial Services', 'Banks - Regional', 'Valley National Bancorp é uma holding bancária e uma holding financeira. A principal subsidiária da Companhia é o Valley National Bank. Seus segmentos incluem Consumer Banking, Commercial Banking e Tesouraria e Corporate Other. O Consumer Banking é composto por hipotecas residenciais e empréstimos de automóveis, e em menor medida, linhas pessoais garantidas de crédito, empréstimos de capital próprio e outros empréstimos ao consumidor. O Consumer Banking também inclui a divisão de serviços de gestão de patrimônio e seguros, composta por consultoria de gestão de ativos, corretagem, confiança, seguro pessoal e título, serviços de consultoria de crédito fiscal e negócios bancários privados internacionais e domésticos. O Banco Comercial compreende taxas flutuantes e taxas ajustáveis empréstimos comerciais e industriais e empréstimos de construção, e empréstimos imobiliários comerciais e comerciais, com taxas fixas e ajustáveis. Também oferece serviços financeiros de nicho, incluindo produto', 'Morristown, NJ, United States', 3732);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AR', 'STOCK', 'Antero Resources Corporation', 'NYQ', 'Energy', 'Oil & Gas E&P', 'Antero Resources Corporation is an independent natural gas and natural gas liquids (NGLs) company. The Company is engaged in the acquisition, development and production of unconventional properties located in the Appalachian Basin in West Virginia and Ohio. The Companys segments include the exploration, development and production of natural gas, NGLs and oil; marketing of excess firm transportation capacity, and midstream services through its equity method investment in Antero Midstream. The Company targets large, repeatable resource plays where horizontal drilling and advanced fracture stimulation technologies provide the means to economically develop and produce natural gas, NGLs and oil from unconventional formations. The Company holds approximately 521,000 net acres of natural gas, NGLs and oil properties located in the Appalachian Basin primarily in West Virginia and Ohio.', 'Denver, CO, United States', 616);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCO', 'STOCK', 'Clear Channel Outdoor Holdings, Inc.', 'NYQ', 'Communication Services', 'Advertising Agencies', 'Clear Channel Outdoor Holdings, Inc. operates in the out-of-home advertising industry. The Company''s dynamic advertising platform is broadening the pool of advertisers using its medium through the expansion of digital billboards and displays and the integration of data analytics and programmatic capabilities that deliver measurable campaigns that are simpler to buy. The Company is a provider of out-of-home advertising solutions, offering advertisers opportunities to reach mass audiences across a variety of high-traffic public spaces. Clear Channel Outdoor RADAR, is its data-driven solution for planning, measuring and amplifying the impact of out-of-home advertising. Its segments include America and Airports. The America segment consists of its United States operations excluding airports. The America segment includes roadside billboard displays. The Airports segment includes the operations of the United States and Caribbean airports.', 'San Antonio, TX, United States', 4100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CFLT', 'STOCK', 'Confluent, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'Confluent, Inc. provides a data streaming platform that enables customers to connect their applications, systems, and data layers and can be deployed as a fully-managed cloud-native software-as-a-service (SaaS) offering, Confluent Cloud, as a self-managed software offering, Confluent Platform, or as a Bring Your Own Cloud (BYOC) managed service offering where the raw data resides inside a customers own cloud environment, WarpStream. The Company also offers professional services and educational services. The Company is focused on developing a category of data infrastructure focused on data in motion for developers and enterprises. Its cloud-native offering works across multi-cloud and hybrid infrastructures and supports a variety of deployment models to support diverse customer requirements, delivering massive scalability, elasticity, security, and global interconnectedness, enabling agile development. WarpStream offers a lower-cost option for relaxed latency use cases for customers.', 'Mountain View, CA, United States', 3060);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COMM', 'STOCK', 'CommScope Holding Company, Inc.', 'NMS', 'Technology', 'Communication Equipment', 'CommScope Holding Company, Inc. is a global provider of infrastructure solutions for communication, data center and entertainment networks. Its solutions for wired and wireless networks enable service providers to deliver media, voice, IP data services and Wi-Fi to their subscribers and allow enterprises to experience constant wireless and wired connectivity across complex and varied networking environments. Its segments include Connectivity and Cable Solutions (CCS), Networking, Intelligent Cellular and Security Solutions (NICS), and Access Network Solutions (ANS). CCS segment provides fiber optic and copper connectivity and cable solutions for use in telecommunications, cable television, residential broadband networks, data centers and others. NICS segment provides wireless networks for enterprises and service providers. ANS segments product solutions include cable modem termination systems (CMTS), video infrastructure, distribution and transmission equipment and cloud solutions.', 'Claremont, NC, United States', 20000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEKE', 'STOCK', 'KE Holdings Inc.', 'NYQ', 'Real Estate', 'Real Estate Services', 'KE Holdings Inc is a holding company mainly engaged in housing transactions and related services. The Company operates in four segments. The Existing Home Transaction Services segment mainly provides agency services to sales or leases of existing homes, and platform and franchise services to brokerage firms on Beike platform, as well as other transaction services. The New Home Transaction Services segment mainly provides new home transaction and agency services to real estate developers. The Home Renovation and Furnishing segment provides a one-stop solution to give housing customers access to a comprehensive range of home renovation and furnishing, ranging from interior design, renovation, re-modeling, furnishing, supplies, to after-sales maintenance and repair. The Emerging and Other Services segment is engaged in rental property management service business, financial service business and others.', 'Beijing, , China', 135072);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EDIT', 'STOCK', 'Editas Medicine, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Editas Medicine, Inc. is a genome-editing company developing potentially transformative genomic medicines to treat a broad range of serious diseases. It has developed a proprietary gene editing platform based on CRISPR technology that includes CRISPR/Cas9, CRISPR/Cas12a, engineered forms and foundational intellectual property for both CRISPR systems. CRISPR uses a protein-RNA complex composed of an enzyme, including either Cas9 (CRISPR-associated protein 9) or Cas12a (CRISPR from Prevotella and Francisella 1, also known as Cpf1), bound to a guide RNA molecule designed to recognize a particular DNA sequence. It is engaged in discovering, developing, manufacturing, and commercializing durable, precision in vivo gene-editing medicines for a broad class of diseases. Vivo medicines include vivo editing of hematopoietic stem cells (HSCs), liver cells and other tissues. Vivo gene editing in HSCs supports the advancement of research programs to treat non-malignant hematological diseases.', 'Cambridge, MA, United States', 246);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAL', 'STOCK', 'Delta Air Lines, Inc.', 'NYQ', 'Industrials', 'Airlines', 'A Delta Air Lines, Inc. Fornece transporte aéreo regular para passageiros e cargas em todos os Estados Unidos e em todo o mundo. A empresa tem hubs e mercados em Amsterdã, Atlanta, Bogotá, Boston, Detroit, Lima, London-Heathrow, Los Angeles, Cidade do México, Minneapolis-St. Paulo, New York-JFK and LaGuardia, Paris-Charles de Gaulle, Salt Lake City, Santiago (Chile), São Paulo, Seattle, Seul-Incheon, e Tóquio. Seus segmentos incluem Companhia Aérea e Refinaria. Seu segmento de companhias aéreas é gerenciado como uma única unidade de negócios que fornece transporte aéreo regular para passageiros e cargas em todo os Estados Unidos e em todo o mundo e inclui seu programa de fidelidade, bem como outros negócios auxiliares. Seu segmento de refinaria opera para o benefício do segmento de companhias aéreas, fornecendo combustível a jato para o segmento de companhias aéreas a partir de sua própria produção e por meio de combustível a jato obtido por meio de acordos com terceiros. A produção da', 'Atlanta, GA, United States', 103000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDNS', 'STOCK', 'Cadence Design Systems, Inc.', 'NMS', 'Technology', 'Software - Application', 'Cadence Design Systems, Inc. É uma empresa de design de sistemas eletrônicos. A Empresa aplica sua estratégia de Design Inteligente de Sistemas para entregar software, hardware e propriedade intelectual (IP) que transformam conceitos de design em realidade. Suas categorias de produtos incluem Core Electronic Design Automation (EDA), Semicondutor IP e System Design and Analysis (SD&A). O EDA do núcleo inclui software, hardware e serviços usados para projetar e verificar uma grande variedade de semicondutores. O portfólio de semicondutores IP inclui subsistemas de silício, software e serviços que são usados no projeto de semicondutores. A categoria SD&A inclui o software e os serviços utilizados para projetar e verificar uma grande variedade de sistemas eletrónicos físicos. Seus semicondutores são usados em vários setores, incluindo automotivo, aeroespacial, biotecnologia, hiperescala e computação em nuvem, data centers, telecomunicações, tecnologia médica, Internet das Coisas industrial', 'San Jose, CA, United States', 13152);\n